import './App.css';
import * as React from 'react';
import NavBar from './components/NavBar.js';
import Button from '@mui/material/Button';
import Tabs from '@mui/material/Tab'

function App() {
  return (
    <div>
      <Tabs>
        <Tab label="Item One" {...a11yProps(0)} />
      </Tabs>
    </div>
  );
}


function TextArea() {
  return (
    <textarea></textarea>
  );
}

export default App;
